      "source": [
        "# Load necessary libraries\n",
        "install.packages(\"ggplot2\")\n",
        "install.packages(\"dplyr\")\n",
        "install.packages(\"readr\")\n",
        "install.packages(\"plotly\")\n",
        "\n",
        "library(ggplot2)\n",
        "library(dplyr)\n",
        "library(readr)\n",
        "library(plotly)\n",
        "\n",
        "# Load the dataset\n",
        "crime_data <- read.csv(\"/content/Crime_Data_from_2020.csv\")\n",
        "\n",
        "# Show first few rows of the data to confirm it's loaded correctly\n",
        "head(crime_data)\n",
        "# Limit the dataset to the first 50 rows\n",
        "crime_data <- crime_data[1:50, ]\n",
        "# Bar Chart: Number of Crimes by Crime Code (Crm Cd)\n",
        "ggplot(crime_data, aes(x = Crm.Cd.Desc)) +geom_bar(fill = \"steelblue\") +theme_minimal() +labs(title = \"Number of Crimes by Crime Description\",x = \"Crime Description\", y = \"Count of Crimes\") +theme(axis.text.x = element_text(angle = 90, hjust = 1))\n",
        "\n",
        "# Pie Chart: Proportion of Crimes by Crime Code (Crm Cd)\n",
        "crime_counts <- crime_data %>% group_by(Crm.Cd.Desc) %>% summarise(count = n())\n",
        "\n",
        "pie <- ggplot(crime_counts, aes(x = \"\", y = count, fill = Crm.Cd.Desc)) + geom_bar(stat = \"identity\", width = 1) + coord_polar(theta = \"y\") + labs(title = \"Proportion of Crimes by Crime Description\") + theme_void()\n",
        "\n",
        "pie\n",
        "\n",
        "# Histogram: Distribution of Victim Ages (Vict Age)\n",
        "ggplot(crime_data, aes(x = Vict.Age)) +\n",
        "  geom_histogram(binwidth = 5, fill = \"darkorange\", color = \"black\") +\n",
        "  theme_minimal() +\n",
        "  labs(title = \"Distribution of Victim Ages\",\n",
        "       x = \"Victim Age\", y = \"Frequency\")\n",
        "\n",
        "# Timeline Chart: Number of Crimes Over Time (DATE OCC)\n",
        "ggplot(crime_data, aes(x = as.Date(DATE.OCC), y = Crm.Cd.Desc, color = AREA.NAME)) +\n",
        "  geom_line() +\n",
        "  theme_minimal() +\n",
        "  labs(title = \"Crime Trends Over Time\",\n",
        "       x = \"Date\", y = \"Crime Code\")\n",
        "\n",
        "# Scatter Plot: Victim Age vs Weapon Used Code (Vict Age and Weapon Used Cd)\n",
        "ggplot(crime_data, aes(x = Vict.Age, y = Weapon.Used.Cd, color = AREA.NAME)) +\n",
        "  geom_point() +\n",
        "  theme_minimal() +\n",
        "  labs(title = \"Victim Age vs Weapon Used Code\",\n",
        "       x = \"Victim Age\", y = \"Weapon Used Code\")\n",
        "\n",
        "# Bubble Plot: Crime by Location and Victim Age (Bubble size = Vict Age)\n",
        "ggplot(crime_data, aes(x = LAT, y = LON, size = Vict.Age, color = Crm.Cd.Desc)) +\n",
        "  geom_point(alpha = 0.6) +\n",
        "  theme_minimal() +\n",
        "  labs(title = \"Crime by Location and Victim Age\",\n",
        "       x = \"Latitude\", y = \"Longitude\")\n",
        "\n"
      ]
